import React, { useState, useEffect } from "react";
import PropTypes from "prop-types";
import PricingRow from "./PricingRow";
import "./DaisyComponents.css";

function getRandomMentorshipSpots() {
  return Math.floor(Math.random() * 10) + 1;
}

function ProfessionalsSection({ sliceRange }) {
  const [professionals, setProfessionals] = useState([]);
  const [selectedField, setSelectedField] = useState("");

  useEffect(() => {
    async function fetchProfessionals() {
      try {
        const response = await fetch("http://localhost:8000/api/random-users/");
        if (!response.ok) {
          throw new Error("Network response was not ok");
        }
        const data = await response.json();
        setProfessionals(data.slice(sliceRange[0], sliceRange[1]));
        console.log('Professionals:', data.slice(sliceRange[0], sliceRange[1])); // Log the updated value here
      } catch (error) {
        console.error("Error fetching professionals:", error);
      }
    }
    fetchProfessionals();
  }, []);

  // Function to handle dropdown selection change
  const handleFieldChange = (event) => {
    setSelectedField(event.target.value);
  };

  // Function to determine the slice range based on the selected field
  const getSliceRange = () => {
    switch (selectedField) {
      case "Cyber Security":
        return [0, 10]; // Example slice range for Cyber Security
      case "Data Management":
        return [11, 20]; // Example slice range for Data Management
      case "Software Engineering":
        return [21, 30]; // Example slice range for Software Engineering
      case "Business Administration":
        return [31, 40]; // Example slice range for Business Administration
      case "Accounting":
        return [41, 50]; // Example slice range for Accounting
      default:
        return sliceRange; // Default to the original slice range
    }
  };

  useEffect(() => {
    if (selectedField) {
      // Fetch professionals with the new slice range when selectedField changes
      fetchProfessionals();
    }
  }, [selectedField]);

  return (
    <>
      <select
        className="select select-primary w-full max-w-xs"
        defaultValue=""
        onChange={handleFieldChange}
      >
        <option value="" disabled>
          Choose Your Field
        </option>
        <option value="Cyber Security">Cyber Security</option>
        <option value="Data Management">Data Management</option>
        <option value="Software Engineering">Software Engineering</option>
        <option value="Business Administration">Business Administration</option>
        <option value="Accounting">Accounting</option>
      </select>

      <div className="overflow-x-auto">
        <table className="table">
          {/* head */}
          <thead>
            <tr>
              <th></th>
              <th>Name</th>
              <th>Years of Experience</th>
              <th>Mentorship Spots Left</th>
              <th></th>
            </tr>
          </thead>
          <tbody>
            {professionals.map((professional, index) => (
              <PricingRow
                key={index}
                firstName={professional.first_name || ""}
                lastName={professional.last_name || ""}
                country={professional.country || ""}
                age={professional.age || ""}
                yoe={professional.years_of_experience || ""}
                picture={professional.picture_large || ""}
                mentorshipSpotsLeft={getRandomMentorshipSpots()}
              />
            ))}
          </tbody>
          {/* foot */}
          <tfoot>
            <tr>
              <th></th>
              <th>Name</th>
              <th>Years of Experience</th>
              <th>Mentorship Spots Left</th>
              <th></th>
            </tr>
          </tfoot>
        </table>
      </div>
    </>
  );
}

ProfessionalsSection.propTypes = {
  sliceRange: PropTypes.array.isRequired,
};

export default ProfessionalsSection;
